import { Row, Col } from "antd";
import PageContent from "../../../layout/components/content/page-content";
import data from "./data";


function maquinas() {
  return (
    <>
      <Row gutter={[32, 32]}>
        <Col span={24} className="text-center">
          <h1 className="centrar-texto">data</h1>

          {/* <data /> */}
        </Col>
      </Row>
    </>
  );
}

export default maquinas
